function classNames(...classes: string[]) {
  return classes.filter(Boolean).join(" ");
}

export default function TextInput() {
  return (
    <main className="flex flex-col justify-end py-10 lg:pl-72 h-full">
          <div className="px-4 sm:px-6 lg:px-8">
            <div className="flex items-center justify-between bg-white border-t border-gray-200 p-4">
              <input
                type="text"
                placeholder="Type your message..."
                className="flex-1 rounded-md border-gray-300 shadow-sm focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm"
              />
              <button className="ml-2 px-4 py-2 bg-indigo-600 text-white rounded-md shadow-sm hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-indigo-500 focus:ring-offset-2">
                Send
              </button>
            </div>
          </div>
        </main>
  );
}
